  false,\n\t\"url\": null,\n\t\"notes\": \"The Back Bay National Wildlife Refuge,
  located in the city of Virginia Beach, Virginia, comprises 4,608 acres of barrier
  beach, fresh and brackish marsh, small woodland areas, and open water. An additional
  4,600 acres of water in Back Bay complement the refuge by serving as a waterfowl
  sanctuary through a closure by Presidential Proclamation. The refuge was established
  June 6, 1938, as a breeding ground and refuge for migratory birds and other wildlife.
  Back Bay is in the center of the historic wintering area for the once endangered
  greater snow geese. Here a variety of ducks and two races of Canada geese spend
  their winters as do several thousand whistling swans. Shore birds, gulls, terns,
  and various other marsh and water birds add to the refuge fauna.  This plan sets
  forth the purposes, management guidelines, and development proposals for the Back
  Bay National Wildlife Refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
